measurements.description:
Fifteen flowers and three buds on one arching inflorescence;  
   dorsal sepal arching, chartreuse, maroon spots coalescing on margins;
   lateral sepals sweeping forward, maroon spots coalescing on margins;

   petals chartreuse, spots and blotches coalescing on margins and distal tips;
  lip white, blotched red on margin and tip, keel white, ciliate;
	column cream, spotted red-brown;   

	substance firm; texture matte.
